import React from 'react'

function Auth({ User }) {
    return (
        <div className='Auth_container'>
            <div className='Auth_container2'>
                <p className='User_Details'>
                    <div className='channel_logo_App'>
                        <p className='fstChar_logo_App'>
                            {
                                User?.result.name ?
                                    <>
                                        {
                                            User?.result.name.charAt(0).toUppercase()
                                        }</> : <>
                                        {
                                            User?.result.name.charAt(0).toUppercase()
                                        }
                                    </>
                            }
                        </p>
                    </div>
                </p>

            </div>

        </div>
    )
}

export default Auth
